var Utils=(function(){
    function getCurrentDate(){
        var currentdate = new Date(); 
        var datetime = Utils.addZero(currentdate.getDate()) + "/"
                + Utils.addZero(currentdate.getMonth()+1) + "/" 
                + Utils.addZero(currentdate.getFullYear()) + " "  
                + Utils.addZero(currentdate.getHours()) + ":"  
                + Utils.addZero(currentdate.getMinutes());
        return datetime;
    };
    function addZero(digit){
        if(digit<10){
            return "0"+digit;
        }
        return digit;
    };
    function randomDate(start, end) {
        return new Date(start.getTime() + Math.random() * (end.getTime() - start.getTime()));
    };
    return {
        getCurrentDate:getCurrentDate,
        addZero:addZero,
        randomDate:randomDate
    };
})();

(function ( $ ) {
 
    $.fn.specialSelect = function() {
        var select=$(this).attr("select");
        var textToSet=$("#"+select+" :nth-child(1)").html();
        var obj=$(this);
        $(this).find('.especial-select-text').each(function(){
            $(this).html(textToSet);
            $(this).width($(obj).width()-40);
        });
        $(this).click(function(){   
            var parent = $("<div>",{class: "special-select-parent"});
            var dialog = $("<div>", {class: "special-select-dialog"});
            $("#"+select+" option").each(function(){
                var row=$("<div>",{class:"special-select-dialog-row", value:$(this).val()});
                $(row).append($(this).html());
                $(row).click(function(){
                    $("#"+select+" option[value='"+$(row).attr('value')+"']").prop('selected', true);
                    $("#"+select).change();
                    var textToSet=$(this).html();
                    $(obj).find('.especial-select-text').each(function(){
                        $(this).html(textToSet);
                        $(this).width(obj.width()-40);
                    });
                    $(parent).remove();
                });
                $(dialog).append(row);
            });
            $(parent).hide();
            $(parent).append(dialog);
            $(this).parent().append(parent);
            $(parent).show();
        });
        $("#"+select).change(function(){
            var textToSet=$("#"+select+" :nth-child(1)").html();
            $(obj).find('.especial-select-text').each(function(){
                $(this).html(textToSet);
                $(this).width($(obj).width()-40);
            });
        });
        $("#"+select).resize(function(){
            var textToSet=$("#"+select+" :nth-child(1)").html();
            $(obj).find('.especial-select-text').each(function(){
                $(this).html(textToSet);
                $(this).width($(obj).width()-40);
            });
        });
    };
 
}( jQuery ));